@import url('https://fonts.googleapis.com/css2?family=Newsreader:wght@300;400&family=Quicksand:wght@300;400;500&family=Gugi&display=swap');
@import "./node_modules/@glidejs/glide/src/assets/sass/glide.core.scss";
@import "./node_modules/@glidejs/glide/src/assets/sass/glide.theme.scss";

$first-bg: #293950;
$radial-bg-left-hero: radial-gradient(circle at -10%, #aad9eb 0, #2a5b6d 15%, #293950 25%);
$radial-bg-left: radial-gradient(circle at -10%, #39aad3 0, #2a5b6d 10%, #293950 25%);
$radial-bg-right: radial-gradient(circle at 115%, #cae1eb 0, #2a5b6d 10%, #293950 25%);
$second-bg: #2e2e2e;
$nav-background-color: #2c2c2c;
$green-background-color: #88AA00;
$light-font-color: #e7e7e7;
$primary-font: 'Newsreader', serif;
$secondary-font: 'Quicksand', sans-serif;
$menu-font: 'Gugi', cursive;

*, *::before, *::after {
  box-sizing: border-box;
}

html,
body {
  margin: 0;
  padding: 0;
  color: $second-bg;
  background: $first-bg;
}

html {
  overflow-x: hidden;
  overflow-y: scroll;
  scroll-behavior: smooth;
}

* > a {
  font-family: $secondary-font;
  color: $light-font-color;
  text-decoration: none;
}

* > p,
span {
  font-family: $primary-font;
}

.scroll-up-bar {
	position: fixed;
	bottom: 1rem;
	right: 2rem;
	width: 5rem;
	padding: 20px 0;
	text-align: center;
	background-color: rgba($color: #000000, $alpha: 0);
	z-index: 20;
  transform: translate(0, 200%);
	transition: all .5s ease-in-out;
}

.scroll-down {

	.scroll-up-bar {
		transform: translate(0, 0);
	}

}

.scroll-up {

	.scroll-up-bar {
		visibility: visible;
	}

}

.menu-is-open {
	overflow: hidden;

	header {
		filter: none;
	}

}

.preloader {
  padding: 0;
  margin: 0;
  width: 100%;
  height: 100vh;
  background-color: $first-bg;
  position: fixed;
  z-index: 5;
  transition: all 2s cubic-bezier(0.075, 0.82, 0.165, 1);

  svg {
    opacity: 0.025;
  }

  p:nth-child(2) {
    position: absolute;
    top: 15%;
    left: 50%;
    transform: translateX(-50%);
    color: #acabab;  
    font-family: $primary-font;
    font-weight: 300;
    font-size: 1.5em;
    letter-spacing: .2em;
  }

  p:nth-child(4) {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translateX(-50%);
    color: #77aeb8; 
    font-family: $menu-font;
    font-size: 3em;
    text-align: center;
  }

  .loading {
    position: absolute;
    border: 16px solid #cfcfcf; /* Light grey */
    border-top: 16px solid #4f97a3; /* Blue */
    border-radius: 50%;
    width: 5em;
    height: 5em;
    animation: spin 2s linear infinite;
    top: 30%;
    left: 46%;

    @keyframes spin {
      0% { 
        transform: rotate(0deg); 
      }
      100% { 
        transform: rotate(360deg); 
      }
    }

  }

}

.preload-finish {
  opacity: 0;
  pointer-events: none;
}

main {
  height: 100vh;

  #scene-container {
    position: absolute;
    top: 0;
    left: 0;
    z-index: -1;
    width: 100%;
    height: 90vh;
    opacity: .8;
  }

  .hero {
    position: absolute;
    height: 100vh;
    width: 100%;
    display: grid;
    grid-template-columns: 1fr 2fr;
    grid-template-rows: 1fr;
    grid-template-areas: 
      "left1 right1" 
      "left1 right1";
    gap: .5em;

    .hero__div-left {
      position: relative;
      grid-area: left1;
      height: 100vh;

      .nav {

        ul {
          margin-block-start: 0;
          margin-block-end: 0;
          margin-inline-start: 0;
          margin-inline-end: 0;
          padding-inline-start: 0;
          list-style-type: none;
          display: inline;
          font-size: 2.5em;
          letter-spacing: .4em;

          li {
            padding: 6.7rem 0 0 4rem;
            display: flex;
            
            a {
              position: relative;
              font-family: $menu-font;
              display: flex;
              flex-wrap: nowrap;

              &::before {
                content: '';
                display: inline-block;
                background-color: #d8c174;
                width: .08em;
                height: 1em;
                vertical-align: middle;
                margin-bottom: .2em;
                margin-right: .5em;
                border-radius: 2px;
                transition: all .5s cubic-bezier(0.075, 0.82, 0.165, 1);
              }

              &::after {
                content: '';
                position: absolute;
                display: inline-block;
                background-color: #0f0f0f00;
                width: 8em;
                height: .08em;
                vertical-align: middle;
                margin-bottom: .2em;
                margin-left: .08em;
                top: 1.5em;
                left: -10em;
                border-radius: 2px;
                transition: all .1s cubic-bezier(1, 0.5, 0.5, 1);
              }

              &:hover {
                color: #d8c174;
                transition: all 1s cubic-bezier(0.075, 0.82, 0.165, 1);

                &::before {
                  content: '';
                  display: inline-block;
                  background-color: rgba($color: #000000, $alpha: 0);
                  width: .08em;
                  height: 1em;
                  vertical-align: middle;
                  margin-bottom: .2em;
                  margin-right: .5em;
                  border-radius: 2px;
                  transition: all .5s cubic-bezier(0.075, 0.82, 0.165, 1);
                }

                &::after {
                  content: '';
                  position: absolute;
                  display: inline-block;
                  background-color: #d8c174;
                  width: 8em;
                  height: .08em;
                  vertical-align: middle;
                  margin-bottom: .2em;
                  margin-left: .08em;
                  top: 1.5em;
                  left: .5em;
                  border-radius: 2px;
                  transition: all .1s cubic-bezier(.75, 0.25, 0.5, 1);
                }

              }

            }

          }

        }

      }

    }

    .hero__div-right {
      position: relative;
      grid-area: right1;
      height: 100vh;

      .hero__div-logo {
        position: absolute;
        width: 25rem;
        top: 40%;
        left: 50%;
        transform: translate(-50%, -40%);

        svg {
          filter: drop-shadow(2px 2px 5px #303030);
        }

      }

    }

  }

}

